DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `AFTER_ACC_BANK_TXN_INSERT` */$$

/*!50003 CREATE */ /*!50003 TRIGGER `AFTER_ACC_BANK_TXN_INSERT` AFTER INSERT ON `ACC_BANK_TXN` FOR EACH ROW BEGIN

