DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `AFTER_ACC_MERCHANT_PAYMENTS_INSERT` */$$

/*!50003 CREATE */ /*!50003 TRIGGER `AFTER_ACC_MERCHANT_PAYMENTS_INSERT` AFTER INSERT ON `ACC_MERCHANT_PAYMENTS` FOR EACH ROW BEGIN
    declare VAR_CUM_BALANCE FLOAT default 0;
