    declare VAR_PAYMENT_ACCOUNT_NAME VARCHAR(200) default NULL;
    declare VAR_BANK_ACC_NO VARCHAR(200) default NULL;


    SELECT
        SELLER_NO
        ,NAME
        ,MOBILE_NO
