                                        SET ALL_SUCCESS_3 = ALL_SUCCESS_3 + 1;


                                        SELECT concat(vendor_name,' ',invoice_date,' ',invoice_no,'(',int_product_count_invoice,')') INTO var_invoice_details_part;


                                        IF var_invoice_details = '0' THEN
