                    END IF;

                CLOSE cur_PROC_SC_BOXING_LIST_INV_STOCK;

                END Block2;
                /*-------------------------BLOCK 2 ENDS ------------------------------*/


                   IF int_count_updated_row != var_arrary_param3 THEN
                     /*UPDATE INV_STOCK
