                    END LOOP get_PROC_SC_PACKAGING_LIST_INV_STOCK;

                    END IF;

                CLOSE cur_PROC_SC_PACKAGING_LIST_INV_STOCK;

                  IF ALL_SUCCESS = int_box_row_count AND OUT_STATUS_2 = 'success' AND OUT_STATUS_3 = 'success' THEN
