/*!50003 CREATE PROCEDURE `PROC_SC_SHIPMENT_CANCELLED`(IN_INVOICE_FOR VarChar(40), IN_SHIPMENT_PK_NO Integer(11), OUT OUT_STATUS VarChar(20))
    NO SQL
