                        END IF;

                                                /*  SET j = j + 1;*/
                          SET is_freight = 0;

                    END LOOP get_PROC_SLS_BOOKING;

                    END IF;

                CLOSE cur_PROC_SLS_BOOKING;

                SET i = i + 1;

                END WHILE;

                IF ALL_SUCCESS = IN_ROW_COUNT THEN
