('21',NULL,'53','1037','1501037','Strawberry','স্ট্রবেরি',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1008','EB1008','1500','1500',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','5','1',NULL,NULL,'2','2022-03-16 20:06:46',NULL,'2022-03-16 20:06:46',NULL,'strawberry','0',NULL,NULL,'Fruits | Strawberry-স্ট্রবেরি | Per kg','Fruits , Strawberry-স্ট্রবেরি, Per kg, স্ট্রবেরি',NULL,NULL,NULL,'<p>Strawberry-স্ট্রবেরি</p>',NULL,'<p>The strawberry is a highly nutritious fruit, loaded with vitamin C and powerful antioxidants. Studies show that strawberries have many benefits for health.<br></p>',NULL),
('22',NULL,'53','1038','1501038','Papaya- Paka Pepe ± 50 gm','পেঁপে- পাকা পেঁপে ± ৫০ গ্রাম',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1009','EB1009','139','139',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-20 19:13:51',NULL,'2022-03-20 19:13:51',NULL,'papaya-paka-pepe-50-gm','0',NULL,NULL,'Fruits - ফল | Papaya- Paka Pepe ± 50 gm | পেঁপে- পাকা পেঁপে ± ৫০ গ্রাম','Fruits , ফল , Papaya,Paka Pepe , 50 gm , পেঁপে,পাকা পেঁপে , ৫০ গ্রাম',NULL,NULL,NULL,'<p><span style=\"color: rgb(10, 10, 10); font-family: Montserrat, sans-serif; font-size: 16px; letter-spacing: normal; background-color: rgb(254, 254, 254);\">Papaya, also known as pawpaw</span><span style=\"color: rgb(10, 10, 10); font-family: Montserrat, sans-serif; font-size: 16px; letter-spacing: normal; background-color: rgb(254, 254, 254);\">&nbsp;or papaw, is a tropical fruit.</span><br></p>',NULL,'<p><span style=\"font-family: &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px; letter-spacing: normal;\">Deliciously sweet, papaya fruit is another gift of Mexicans to this world. This exotic fruit is packed with numerous health-benefiting nutrients. It is one of the favorites of fruit lovers for its nutritional, digestive, and medicinal properties.</span></p><p style=\"box-sizing: inherit; font-family: &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px; letter-spacing: normal;\">The papaya tree bears many spherical or pear-shaped fruits clumped together near its top end of the trunk. They come in a variety of sizes ranging from 6-20 inches in length and 4-12 inches in diameter. The average-sized papaya weighs about a pound. The fruit is said to ripen when it yields to gentle thumb pressure, and its skin turned amber to an orange tint.</p><p style=\"box-sizing: inherit; font-family: &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px; letter-spacing: normal;\">Inside, the fruit features numerous black peppercorn-like seeds, encased in a mucin coat concentrated at its hollow, central cavity as in melons. The flesh is orange in color with either yellow or pink hues, soft, and has a deliciously sweet taste with a rich, musky flavor.</p><p><br></p>','<p>সুস্বাদু মিষ্টি, পেঁপে ফল এই বিশ্বের কাছে মেক্সিকানদের আরেকটি উপহার। এই বহিরাগত ফলটি অসংখ্য স্বাস্থ্য-উপকারী পুষ্টিতে ভরপুর। এটি তার পুষ্টি, পাচক এবং ঔষধি বৈশিষ্ট্যগুলির জন্য ফল প্রেমীদের অন্যতম প্রিয়।</p><div>পেঁপে গাছটি অনেকগুলি গোলাকার বা নাশপাতি-আকৃতির ফল বহন করে যা ট্রাঙ্কের উপরের প্রান্তের কাছে একসাথে আটকে থাকে। এগুলি দৈর্ঘ্যে 6-20 ইঞ্চি এবং 4-12 ইঞ্চি ব্যাসের বিভিন্ন আকারের মধ্যে আসে। গড় আকারের পেঁপের ওজন প্রায় এক পাউন্ড। ফলটি যখন মৃদু থাম্ব প্রেসারে উৎপন্ন হয় তখন এটি পাকা হয় বলে মনে করা হয়, এবং এর ত্বক একটি কমলা টিন্টে অ্যাম্বার হয়ে যায়।</div><div>ভিতরে, ফলটিতে অসংখ্য কালো মরিচের মতো বীজ রয়েছে, যা তরমুজের মতো তার ফাঁপা, কেন্দ্রীয় গহ্বরে ঘনীভূত একটি মিউসিন কোটের মধ্যে আবদ্ধ। মাংস হলুদ বা গোলাপী রঙের সাথে কমলা রঙের, নরম, এবং একটি সমৃদ্ধ, কস্তুরী স্বাদ সঙ্গে একটি সুস্বাদু মিষ্টি স্বাদ আছে।<br></div>'),
('23',NULL,'53','1039','1501039','Daab (Green Coconut)','ডাব (সবুজ নারকেল)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1010','EB1010','99','99',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-20 20:02:37',NULL,'2022-03-20 20:02:37',NULL,'daab-green-coconut','0',NULL,NULL,'Fruits - ফল | Daab (Green Coconut) - ডাব (সবুজ নারকেল) | Each','Fruits - ফল, Daab (Green Coconut), ডাব (সবুজ নারকেল) ,Each',NULL,NULL,NULL,'<p><font color=\"#767676\" face=\"Roboto, Helvetica, sans-serif\"><span style=\"letter-spacing: normal;\"><b>Daab (Green Coconut)-ডাব (সবুজ নারকেল)</b></span></font></p><p><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">Green coconut</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">&nbsp;or young</span><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">&nbsp;coconut</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">&nbsp;is a very popular fruit all over the world.</span><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">&nbsp;Green coconut</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">&nbsp;produces more water than the brown or mature</span><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">&nbsp;coconut.</span><br></p>',NULL,'<p><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">Coconut</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">&nbsp;water is one of the healthiest beverages to survive the heat.</span><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">&nbsp;Green Coconut (Daab)</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">&nbsp;water is the juice inside the young</span><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">&nbsp;coconut.</span><br></p>','<p>নারকেল জল তাপ থেকে বেঁচে থাকার জন্য স্বাস্থ্যকর পানীয়গুলির মধ্যে একটি। সবুজ নারকেল (ডাব) জল হল তরুণ নারকেলের অভ্যন্তরের রস।<br></p>'),
('24',NULL,'53','1040','1501040','Pomegranate (Dalim)','ডালিম',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1011','EB1011','190','190',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-20 20:47:50',NULL,'2022-03-20 20:47:50',NULL,'pomegranate-dalim','0',NULL,NULL,'Fruits - ফল | Pomegranate (Dalim) | ডালিম - 2 Pcs','Fruits , ফল |, Pomegranate , Dalim , ডালিম,  2 Pcs',NULL,NULL,NULL,'<p>Pomegranate (Dalim)-ডালিম&nbsp;<br></p>',NULL,'<p><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">Pomegranate</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">&nbsp;fruit is one of the most popular, nutritionally rich fruit with unique flavor, taste, and health promoting characteristics.&nbsp;</span></p><p><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">Red-purple in color, the pomegranate fruit husk&nbsp;</span><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">has two parts: an outer, hard</span> pericarp<span style=\"box-sizing: border-box; font-size: 1rem; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: 0.5px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;</span>pericarp<span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">, and an inner, spongy&nbsp;</span><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">mesocarp (white \"albedo\"), which comprises the fruit inner wall where seeds attach.</span><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">Membrane</span>s of the mesocarp are organized as nonsymmetric chambers that contain seeds inside sarcotestas, which are embedded without attachment to the mesocarp. Containing juice, the sarcotestas is formed as a thin membrane derived from the epidermal cells of the seeds. The number of seeds in a pomegranate can vary from 200 to about 1,400.</p>','<p>ডালিম ফল অনন্য স্বাদ, স্বাদ, এবং স্বাস্থ্য প্রচারের বৈশিষ্ট্যগুলির সাথে সবচেয়ে জনপ্রিয়, পুষ্টিকরভাবে সমৃদ্ধ ফলগুলির মধ্যে একটি।</p><p>লাল-বেগুনি রঙের, ডালিম ফলের ভুষির দুটি অংশ রয়েছে: একটি বাহ্যিক, হার্ড পেরিকার্প পেরিকার্প, এবং একটি অভ্যন্তরীণ, স্পঞ্জি মেসোকার্প (সাদা \"অ্যালবেডো\"), যা ফলের অভ্যন্তরের প্রাচীর নিয়ে গঠিত যেখানে বীজ সংযুক্ত থাকে।মেসোকার্পের ঝিল্লিগুলি ননসিমেট্রিক চেম্বার হিসাবে সংগঠিত হয় যা সারকোটেস্টাসের অভ্যন্তরে বীজ ধারণ করে, যা মেসোকার্পের সাথে সংযুক্তি ছাড়াই এম্বেড করা হয়। রস ধারণকারী, সারকোটেস্টাস বীজের এপিডার্মাল কোষ থেকে প্রাপ্ত একটি পাতলা ঝিল্লি হিসাবে গঠিত হয়। ডালিমে বীজের সংখ্যা ২০০ থেকে প্রায় ১,৪০০ পর্যন্ত হতে পারে।<br></p>'),
('25',NULL,'53','1041','1501041','Grapes (Green)± 20 gm','আঙ্গুর (সবুজ) ± 20 গ্রাম',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1012','EB1012','75','75',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-20 20:59:23',NULL,'2022-03-20 20:59:23',NULL,'grapes-green-20-gm','0',NULL,NULL,'Fruits - ফল | Grapes (Green)± 20 gm | আঙ্গুর (সবুজ)  ± 20 গ্রাম','Fruits , ফল , Grapes , Green , 20 gm , আঙ্গুর ,সবুজ,  ± 20 গ্রাম',NULL,NULL,NULL,'<p>Grapes (Green)-আঙ্গুর (সবুজ)<br></p>',NULL,'<p><span style=\"color: rgb(45, 45, 45); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: normal;\">Grapes are small, round or oval-shaped fruit, gives us a sour or sweet taste and these can be with seeds or seedless.</span></p><p><span style=\"color: rgb(45, 45, 45); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: normal;\">Grapes are cholesterol, sodium, and fat-free fruits and are thus very advantageous for the human body.&nbsp;</span><span style=\"color: rgb(45, 45, 45); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: normal;\">Green grapes are also called white grapes. Grapes are small packets of nutrients and antioxidants and have unimaginable benefits on human health by preventing many diseases.</span><span style=\"color: rgb(45, 45, 45); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: normal;\"><br></span><br></p>','<p>আঙ্গুর ছোট, বৃত্তাকার বা ডিম্বাকৃতি-আকৃতির ফল, আমাদের একটি টক বা মিষ্টি স্বাদ দেয় এবং এগুলি বীজ বা বীজহীন হতে পারে।</p><p><br></p><p>আঙ্গুর কোলেস্টেরল, সোডিয়াম এবং চর্বি-মুক্ত ফল এবং এইভাবে মানব দেহের জন্য খুব সুবিধাজনক। সবুজ আঙুরকে সাদা আঙুরও বলা হয়। আঙ্গুর পুষ্টি এবং অ্যান্টিঅক্সিডেন্টগুলির ছোট প্যাকেট এবং অনেক রোগ প্রতিরোধ করে মানব স্বাস্থ্যের উপর অকল্পনীয় সুবিধা রয়েছে।</p>'),
('26',NULL,'53','1042','1501042','Green Apple± 50 gm','সবুজ আপেল± 50 গ্রাম',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1013','EB1013','123','123',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-20 21:05:33','2','2022-04-13 18:08:58',NULL,'green-apple-50-gm','0',NULL,NULL,'Fruits - ফল | Green Apple± 50 gm | সবুজ আপেল± 50 গ্রাম | 1kg','Fruits , ফল , Green , Apple ,Green Apple,50 gm , সবুজ আপেল , 50 গ্রাম , 1kg',NULL,NULL,NULL,'<p>Green Apple± 50 gm-সবুজ আপেল± 50 গ্রাম<br></p>',NULL,'<p><span style=\"font-size: 1rem; color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif;\">Green apples</span><span style=\"font-size: 1rem; color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif;\"> are slightly more sour than red</span><span style=\"font-size: 1rem; color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif;\"> apples.</span><span style=\"font-size: 1rem; color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif;\"> </span><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">Green apples</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\"> contain a compound called pectin, a fiber source that works as a prebiotic to promote the growth of healthy bacteria in your gut.</span><br></p>','<p>সবুজ আপেল লাল আপেলের চেয়ে কিছুটা বেশি টক। সবুজ আপেলে পেকটিন নামক একটি যৌগ থাকে, এটি একটি ফাইবার উত্স যা আপনার অন্ত্রে স্বাস্থ্যকর ব্যাকটিরিয়ার বৃদ্ধিকে উন্নীত করার জন্য প্রিবায়োটিক হিসাবে কাজ করে।<br></p>'),
