া হয়, তবে এই দাবিগুলির ব্যাক আপ করার জন্য কোনও বৈজ্ঞানিক প্রমাণ নেই।</p><p>&nbsp;এটি চিকিৎসার কাজেও ব্যবহৃত হয়।</p>'),
