('22','24','11','54f5sd4f5sd4f33','150100811','EB101111','11','pomegranate-dalim-2-pcs','Pomegranate (Dalim)-2 pcs','ডালিম-2 পিসি',NULL,'29','Weight','55','2 pcs',NULL,NULL,NULL,NULL,'2','0',NULL,'/media/images/products/24/thumb/prod_20032022_623722b58985e.webp','/media/images/products/24/prod_20032022_623722b58985e.png','159',NULL,'160',NULL,'0','0','1','0',NULL,'<p><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">Pomegranate</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">&nbsp;fruit is one of the most popular, nutritionally rich fruit with unique flavor, taste, and health promoting characteristics.&nbsp;</span></p><p><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">Red-purple in color, the pomegranate fruit husk&nbsp;</span><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">has two parts: an outer, hard</span>&nbsp;pericarp<span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;</span>pericarp<span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">, and an inner, spongy&nbsp;</span><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">mesocarp (white \"albedo\"), which comprises the fruit inner wall where seeds attach.</span><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">Membrane</span>s of the mesocarp are organized as nonsymmetric chambers that contain seeds inside sarcotestas, which are embedded without attachment to the mesocarp. Containing juice, the sarcotestas is formed as a thin membrane derived from the epidermal cells of the seeds. The number of seeds in a pomegranate can vary from 200 to about 1,400.</p>',NULL,'Pomegranate (Dalim)- ডালিম - 2 pcs',NULL,'Pomegranate (Dalim)-2 pcs  2 pcs  Fresh Fruits EB101111   Pomegranate  &nbsp;fruit is one of the most popular, nutritionally rich fruit with unique flavor, taste, and health promoting characteristics.&nbsp;    Red-purple in color, the pomegranate fruit husk&nbsp;  has two parts: an outer, hard &nbsp;pericarp &nbsp; pericarp , and an inner, spongy&nbsp;  mesocarp (white \"albedo\"), which comprises the fruit inner wall where seeds attach.  Membrane s of the mesocarp are organized as nonsymmetric chambers that contain seeds inside sarcotestas, which are embedded without attachment to the mesocarp. Containing juice, the sarcotestas is formed as a thin membrane derived from the epidermal cells of the seeds. The number of seeds in a pomegranate can vary from 200 to about 1,400. ',NULL,'Fruits - ফল | Pomegranate (Dalim) | ডালিম - 2 Pcs','Fruits , ফল |, Pomegranate , Dalim , ডালিম,  2 Pcs',NULL,NULL,'1','1',NULL,'1',NULL,NULL,NULL,NULL,'10','2','2022-03-20 20:47:50','2','2022-03-20 20:48:53',NULL,NULL),
