('42','45','11','54f5sd4f5sd4f2121','150102211','EB102511','11','elephant-apple-chalta-per-pcs','Elephant Apple (Chalta)-per pcs','চালতা-প্রতি পিসি',NULL,'29','Weight','56','per pcs',NULL,NULL,NULL,NULL,'2','0',NULL,'/media/images/products/45/thumb/prod_21032022_62384aecf2101.webp','/media/images/products/45/prod_21032022_62384aecf2101.png','29',NULL,'35',NULL,'0','0','1','0',NULL,'<p>Chalta is an eternally green shrub, with the trees often grow up to a height of 15 m. The reddish-brown barks hold strong branches with broad serrated leaves. The flowers bloom in summer, being bright white with many petals and sprout into the tangy chalta fruit in colder climates.</p><p><br></p><p>An expansive array of useful plant constituents are present in chalta fruits, making them a prominent source of vital nutrients. They are inherently rich in vitamin C, vitamin B complex, vitamin E, potassium, healthy fats, amino acids and proteins, besides being low in cholesterol. Moreover, chalta abounds in beneficial phytochemicals namely tannins, saponins, flavonoids, triterpenoids and phenolics, which supply powerful anticancer, antibacterial and antioxidant characteristics.</p>',NULL,'Elephant Apple (Chalta)-per pcs',NULL,'Elephant Apple (Chalta)-per pcs  per pcs  Fresh Fruits EB102511  Chalta is an eternally green shrub, with the trees often grow up to a height of 15 m. The reddish-brown barks hold strong branches with broad serrated leaves. The flowers bloom in summer, being bright white with many petals and sprout into the tangy chalta fruit in colder climates.     An expansive array of useful plant constituents are present in chalta fruits, making them a prominent source of vital nutrients. They are inherently rich in vitamin C, vitamin B complex, vitamin E, potassium, healthy fats, amino acids and proteins, besides being low in cholesterol. Moreover, chalta abounds in beneficial phytochemicals namely tannins, saponins, flavonoids, triterpenoids and phenolics, which supply powerful anticancer, antibacterial and antioxidant characteristics. ',NULL,'Fruits |Elephant Apple (Chalta) | চালতা  | Each','Fruits,Elephant Apple, Chalta , চালতা  , Each , apple , chalta',NULL,NULL,'1',NULL,NULL,'1',NULL,NULL,NULL,NULL,'10','2','2022-03-21 17:51:49','2','2022-03-21 17:52:45',NULL,NULL),
('43','46','11','54f5sd4f5sd4f2222','150102311','EB102611','11','wood-apple-bel-per-pcs','Wood Apple( Bel )-per pcs','বেল-প্রতি পিসি',NULL,'29','Weight','56','per pcs',NULL,NULL,NULL,NULL,'2','0',NULL,'/media/images/products/46/thumb/prod_21032022_62384c49ca79d.webp','/media/images/products/46/prod_21032022_62384c49ca79d.png','75',NULL,'80',NULL,'0','0','1','0',NULL,'<p>The Wood Apple is found through Southeastern Asia and it has several uses in the kitchen. Many people like to work the Wood Apple down in order to turn it into a sweet and slightly tart jam. You can also use the fruit in certain popular drinks such as the Bela Pana which combines water, sugar, citron juice, and of course the Wood Apple to finish things off.</p><div><br></div>',NULL,'Wood Apple( Bel )-per pcs',NULL,'Wood Apple( Bel )-per pcs  per pcs  Fresh Fruits EB102611  The Wood Apple is found through Southeastern Asia and it has several uses in the kitchen. Many people like to work the Wood Apple down in order to turn it into a sweet and slightly tart jam. You can also use the fruit in certain popular drinks such as the Bela Pana which combines water, sugar, citron juice, and of course the Wood Apple to finish things off.    ',NULL,'Fruits | Wood Apple (Bel) | বেল  | Each','Fruits, ফল  , Wood Apple, Bel , বেল  , Each pcs',NULL,NULL,'1',NULL,NULL,'1',NULL,NULL,NULL,NULL,'10','2','2022-03-21 17:57:48','2','2022-03-21 17:58:34',NULL,NULL),
