('47','50','11','54f5sd4f5sd4f2525','150102611','EB102911','11','rambutan-fruit-500g','Rambutan Fruit-500g','রাম্বুটান ফল-500 গ্রাম',NULL,'29','Weight','39','500g',NULL,NULL,NULL,NULL,'2','0',NULL,'/media/images/products/50/thumb/prod_21032022_62385bfa36a6c.webp','/media/images/products/50/prod_21032022_62385bfa36a6c.png','499',NULL,'500',NULL,'0','0','1','0',NULL,'<p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">The rambutan fruit is rich in many vitamins, minerals and beneficial plant compounds.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Its flesh provides around 1.3–2 grams of total fiber per 3.5 ounces (100 grams) — similar to what you would find in the same quantity of apples, oranges or pears .</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">It’s also rich in vitamin C, a nutrient that helps your body absorb dietary iron more easily. This vitamin also acts as an antioxidant, protecting your body’s cells against damage. Eating 5–6 rambutan fruit will meet 50% of your daily vitamin C needs.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Rambutan also contains a good amount of&nbsp;<a href=\"https://www.healthline.com/nutrition/copper-deficiency-symptoms\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">c</a>opper, which plays a role in the proper growth and maintenance of various cells, including those of your bones, brain and heart.</p>',NULL,'Rambutan Fruit-500g',NULL,'Rambutan Fruit-500g  500g  Fresh Fruits EB102911  The rambutan fruit is rich in many vitamins, minerals and beneficial plant compounds.  Its flesh provides around 1.3–2 grams of total fiber per 3.5 ounces (100 grams) — similar to what you would find in the same quantity of apples, oranges or pears .  It’s also rich in vitamin C, a nutrient that helps your body absorb dietary iron more easily. This vitamin also acts as an antioxidant, protecting your body’s cells against damage. Eating 5–6 rambutan fruit will meet 50% of your daily vitamin C needs.  Rambutan also contains a good amount of&nbsp; c opper, which plays a role in the proper growth and maintenance of various cells, including those of your bones, brain and heart. ',NULL,'Fruits | Rambutan Fruit | 500gm','Fruits ,Rambutan Fruit , 500gm,ফল',NULL,NULL,'1',NULL,NULL,'1',NULL,NULL,NULL,NULL,'10','2','2022-03-21 19:04:17','2','2022-03-21 19:05:30',NULL,NULL),
